Here is a basic C++ program that can count the number of occurrences of a specified word in a text file using a function called `count_occurrences()`:
```c++
// include the necessary libraries for I/O operations
#include <fstream>
#include <iostream>
#include <string>

int main() {
    // declare variables
    std::ifstream inputFile;
    std::string word;
    int occurrence = 0;

    // open the text file
    inputFile.open("textfile.txt");
    if (inputFile.is_open()) {
        while (!inputFile.eof()) {
            getline(inputFile, word);

            if (word == "someWord") {
                occurrence++;
            }
        }

        inputFile.close();
    } else {
        std::cerr << "Error opening the file" << std::endl;
    }

    // display the result
    std::cout << "The number of occurrences of \"" << word << "\" is: " << occurrence << std::endl;

    return 0;
}

// function to count the occurrences of a given word
int count_occurrences(const std::string& word) {
    int occurrence = 0;
    char c;

    while ((c = fgetc(stdin))!= EOF) {
        if (c == word[0]) {
            if (strcmp(c + "\n", word) == 0) {
                occurrence++;
            }
        }
    }

    return occurrence;
}
```
In this code, we first include the necessary libraries for I/O operations. We then declare some variables such as the input stream object, the string variable for the current line read from the file, and an integer variable to store the number of occurrences. We also define a function named `count_occurrences()` which takes a string argument and returns its number of occurrences in the input.

We then open the text file using the input stream object `inputFile` and check whether it has been opened successfully or not. If so, we enter into a loop where we read each line from the file using `getline()`. In this loop, we compare the currently read word with the desired word and increment the occurrence variable if they match. Once all lines have been processed, we close the input stream and display the result.

